import React from 'react'
import {withProvider} from './MyProvider'

function Sorted(props) {
    const {name, mascot, head, ghost, founder, members, values, colors} = props
    return(
        <div className={name}>
            {name}!
            <p>Mascot: {mascot}</p>
            <p></p>
        </div>
    )
}

export default withProvider(Sorted)
